import React from 'react';
import Item from './Item.js'

const ListItems = ({itemsArr}) => {
    const itemComponent = itemsArr.forEach(i, itemV => {
        return (
            <Item key={i} itemValue={itemsArr[itemV]}/>
        )
    })
    return (
        <div>
            {itemComponent}
        </div>
    )
}

export default ListItems;
